import "../../styles/components/roundchart.css"
import { RadialBarChart , RadialBar , ResponsiveContainer } from "recharts"

function RoundChart ({input}) {
    let tab = [100]
    let test = {score:(input.score*100)}
    tab.push(test)
    console.log(tab)

    return (
        <ResponsiveContainer width="30%" height={300}>
            <RadialBarChart innerRadius="50%" outerRadius="80%" barSize={10} data={tab} startAngle={360} endAngle={0}>
                <RadialBar minAngle={15} clockWise={true} dataKey="score" background={true} label={{position: "insideStart" , fill:"red"}}/>
            </RadialBarChart>
        </ResponsiveContainer>
    )
}

export default RoundChart
